import { Logo } from "../Component/Logo/Logo";
import image from "C:\\Users\\Mysterious\\Youtubelite\\frontend\\public\\icon.svg"
const Homepage = () => {

    return (
        <div className ="home">
    
            <div className = "header" >
                
                <div className = "Logo"> 
                <Logo src={image}/>
                </div>
              
               <div className = "searchbar"></div>

                <div className = "admin"></div>

            </div>

            <div className = "content">

            </div>

        </div>
    )
}

export default Homepage;
